/// data : [{"ID":1,"post_author":1,"post_date":"2022-08-20 18:07:44","post_date_gmt":"2022-08-20 15:07:44","post_content":"<!-- wp:paragraph -->\n<p>مرحباً بك في ووردبريس. هذه مقالتك الأولى. حررّها أو احذفها، ثم ابدأ النشر!</p>\n<!-- /wp:paragraph -->","post_title":"أهلاً بالعالم !","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"open","post_password":"","post_name":"%d8%a3%d9%87%d9%84%d8%a7-%d8%a8%d8%a7%d9%84%d8%b9%d8%a7%d9%84%d9%85","to_ping":"","pinged":"","post_modified":"2022-08-20 18:07:44","post_modified_gmt":"2022-08-20 15:07:44","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/?p=1","menu_order":0,"post_type":"post","post_mime_type":"","comment_count":1,"categories":[{"term_id":1,"name":"غير مصنف","slug":"%d8%ba%d9%8a%d8%b1-%d9%85%d8%b5%d9%86%d9%81","term_group":0,"pivot":{"object_id":1,"term_taxonomy_id":1}},{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":1,"term_taxonomy_id":58}},{"term_id":59,"name":"العربية","slug":"pll_ar","term_group":0,"pivot":{"object_id":1,"term_taxonomy_id":59}},{"term_id":60,"name":"pll_6300ffce2c14f","slug":"pll_6300ffce2c14f","term_group":0,"pivot":{"object_id":1,"term_taxonomy_id":60}}]},{"ID":2,"post_author":1,"post_date":"2022-08-20 18:07:44","post_date_gmt":"2022-08-20 15:07:44","post_content":"<!-- wp:paragraph -->\n<p>هذا المثال لـ صفحة. تختلف عن مقالة المدونة؛ لأنها ستظل في موضع واحد وستظهر في قائمة روابط الموقع الخاصة بك (في غالبية القوالب). يبدأ معظم الناس بتقديم صفحة التعريف التي يطلق عليها صفحة \"حول\" عادةً لعرضها على زوّار الموقع المحتملين. قد تكون شيئًا كهذا:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>مرحبًا! أعمل نهاراً كساعي بريد، فنان طموح بقية ساعات يومي، وهذا هو موقع الويب الخاص بي. أعيش في المنطقة الغربية، ولدي قط لطيف يُدعى فروزن، أحب الصناعات الخشبية ومهتم بالنقوش والزخرفة (واهتمامات قد تروق لك من هنا وهناك.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...أو شيئًا من هذا القبيل:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>تأسست شركة XYZ في عام 1971، وقدمت العديد من المنتجات ذات الجودة للعامة منذ ذلك الحين. مقرها الرئيسي في لندن، توظّف شركة XYZ أكثر من 2000 شخص، وتقوم بالعديد من الأشياء والأنشطة الرائعة للمجتمع.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>وبصفتك مستخدمًا جديدًا لـ ووردبريس، ينبغي عليك الانتقال إلى <a href=\"https://mo7amedsalah.com/wp-admin/\">لوحة التحكّم</a> الخاصة بك لحذف هذه الصفحة وإنشاء صفحات جديدة مناسبة للمحتوى الخاص بك. استمتع!</p>\n<!-- /wp:paragraph -->","post_title":"مثال على صفحة","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"open","post_password":"","post_name":"مثال-على-صفحة","to_ping":"","pinged":"","post_modified":"2022-08-20 18:07:44","post_modified_gmt":"2022-08-20 15:07:44","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/?page_id=2","menu_order":0,"post_type":"page","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":2,"term_taxonomy_id":58}}]},{"ID":3,"post_author":1,"post_date":"2022-08-20 18:07:44","post_date_gmt":"2022-08-20 15:07:44","post_content":"<!-- wp:heading --><h2>من نحن</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>عنوان موقعنا على الويب: https://mo7amedsalah.com.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>تعليقات</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>عندما يترك الزائرون تعليقاتهم على الموقع، نجمع البيانات الموضحة في نموذج التعليقات، وكذلك عنوان IP الخاص بالزائر وسلسلة وكلاء متصفح المستخدم للمساعدة في اكتشاف الرسائل غير المرغوب فيها.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>قد يتم توفير سلسلة مجهولة المصدر تم إنشاؤها من عنوان بريدك الإلكتروني (وتسمى أيضًا hash) إلى خدمة Gravatar لمعرفة ما إذا كنت تستخدمها. سياسة خصوصية خدمة Gravatar متوفرة هنا: https://automattic.com/privacy/. بعد الموافقة على تعليقك، ستكون صورة ملفك الشخصي مرئية للعامة في سياق تعليقك.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>وسائط</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>إذا قمت بتحميل الصور إلى موقع الويب، يجب تجنب تحميل الصور مع بيانات الموقع المضمنة (EXIF GPS). يمكن لزوّار الموقع تنزيل واستخراج أي بيانات موقع من الصور على موقع الويب.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>ملفات تعريف الارتباط</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>إذا تركت تعليقًا على موقعنا، فيمكنك تمكين حفظ اسمك وعنوان بريدك الإلكتروني وموقعك الإلكتروني في ملفات تعريف الارتباط. هذه هي لراحتك حتى لا تضطر إلى ملء التفاصيل الخاصة بك مرة أخرى عند ترك تعليق آخر. ستستمر ملفات تعريف الارتباط هذه لمدة عام واحد.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>إذا قمت بزيارة صفحة تسجيل الدخول الخاصة بنا، فسنهيئ ملف تعريف ارتباط مؤقت لتحديد ما إذا كان مستعرضك يقبل هذه الملفات. لايحوي ملف تعريف الارتباط هذا أي بيانات شخصية كما يتم التخلص منه عندما تقوم بإغلاق متصفحك.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>عندما تسجّل الدخول نقوم أيضاً بتهيئة ملفات عديدة لتعريف الارتباط من أجل حفظ معلومات دخولك وخيارات شاشة العرض الخاصة بك. ملفات تعريف الارتباط لمعلومات الدخول تبقى ليومين، بينما تبقى ملفات تعريف ارتباط خيارات شاشة العرض لمدة سنة. سيستمر تسجيل دخولك طيلة أسبوعين عندما تختار &quot;تذكرني&quot;، وإذا قمت بتسجيل خروجك من الحساب، سيتم حذف ملفات تعريف ارتباط تسجيل الدخول.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>سيُحفظ ملف إضافي لتعريف الارتباط في مستعرضك إذا قمت بتحرير أو نشر مقال. وهذا الملف لايتضمن أي بيانات شخصية فكل ما في الأمر أنه يشير إلى معرّف المقالة التي حررتها. وستنتهي صلاحيته بعد يوم واحد.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>المحتوى المضمّن من مواقع ويب أخرى</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>المقالات على هذا الموقع قد تشمل محتوى مضمّناً (على سبيل المثال: كمقاطع الفيديو، الصور، المقالات .. الخ).  يتصرّف المحتوى المضمَّن من مواقع ويب أخرى بالطريقة نفسها تماماً كما لو أن الزائر زار الموقع الآخر.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>قد تجمع مواقع الويب هذه بيانات عنك، وتستخدم ملفات تعريف الارتباط، وتقوم بضمين تتبعًا إضافيًا - تابعًا لجهة ثالثة خارجية، وتراقب تفاعلك مع هذا المحتوى المضمّن، بما في ذلك تتبع تفاعلك مع المحتوى المضمن إذا كان لديك حساب وتم تسجيل دخولك إلى ذلك الموقع.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>مع من نشارك بياناتك</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>إذا طلبت إعادة تعيين كلمة المرور، فسيتم تضمين عنوان IP الخاص بك في رسالة البريد الإلكتروني لإعادة التعيين.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>ماهي مدة احتفاظنا ببياناتك</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>إذا تركت تعليقاً، فسيتم الاحتفاظ بالتعليق والبيانات الوصفية الخاصة به إلى أجل غير مسمى. وهذا حتى يمكننا التعرّف على أي تعليقات متتابعة والموافقة عليها تلقائياً بدلاً من الاحتفاظ بها في قائمة انتظار المراجعة للموافقة عليها.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>بالنسبة للمستخدمين الذين قاموا بالتسجيل على موقعنا (إن وجد)، نقوم أيضًا بتخزين المعلومات الشخصية التي يقدمونها في ملف تعريف المستخدم الخاص بهم. يمكن لجميع المستخدمين الاطلاع على معلوماتهم الشخصية أو تعديلها أو حذفها في أي وقت (باستثناء أنه لا يمكنهم تغيير اسم المستخدم الخاص بهم). يمكن لمسؤولي مواقع الويب أيضًا رؤية هذه المعلومات وتحريرها.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>ماهي الحقوق العائدة لك على بياناتك</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>إذا كان لديك حساب على هذا الموقع، أو تركت تعليقات، يمكنك طلب الحصول على ملف يتم تصديره من البيانات الشخصية التي نحتفظ بها عنك، بما في ذلك أي بيانات قدمتها لنا. يمكنك أيضًا طلب حذف أي بيانات شخصية نحتفظ بها عنك. هذا لا يشمل أي بيانات نحن ملزمون بالحفاظ عليها لأغراض إدارية أو قانونية أو أمنية.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">النص المقترح: </strong>يمكن التحقق من تعليقات الزوار من خلال خدمة الكشف عن الرسائل غير المرغوب فيها تلقائيًا.</p><!-- /wp:paragraph -->","post_title":"سياسة الخصوصية","post_excerpt":"","post_status":"draft","comment_status":"closed","ping_status":"open","post_password":"","post_name":"privacy-policy","to_ping":"","pinged":"","post_modified":"2022-08-20 18:07:44","post_modified_gmt":"2022-08-20 15:07:44","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/?page_id=3","menu_order":0,"post_type":"page","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":3,"term_taxonomy_id":58}}]},{"ID":4,"post_author":1,"post_date":"2022-08-20 18:07:57","post_date_gmt":"0000-00-00 00:00:00","post_content":"","post_title":"مسودة تلقائية","post_excerpt":"","post_status":"auto-draft","comment_status":"open","ping_status":"open","post_password":"","post_name":"","to_ping":"","pinged":"","post_modified":"2022-08-20 18:07:57","post_modified_gmt":"0000-00-00 00:00:00","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/?p=4","menu_order":0,"post_type":"post","post_mime_type":"","comment_count":0,"categories":[]},{"ID":5,"post_author":1,"post_date":"2022-08-20 18:17:28","post_date_gmt":"2022-08-20 15:17:28","post_content":"","post_title":"الدفع","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"lp-checkout","to_ping":"","pinged":"","post_modified":"2022-08-20 18:51:07","post_modified_gmt":"2022-08-20 15:51:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/?page_id=5","menu_order":0,"post_type":"pa