es.</li>\n \t<li>Best suitable for beginners to advanced level users and who learn faster when demonstrated.</li>\n \t<li>Course content designed by considering current software testing technology and the job market.</li>\n \t<li>Practical assignments at the end of every session.</li>\n \t<li>Practical learning experience with live project work and examples.</li>\n</ul>","post_title":"1-Hour Wordpress Basic Tutorial","post_excerpt":"In this tutorial we will provide you with detailed instructions on how to use WordPress to create and manage your site. WordPress can be used for both simple and complex websites. In our WordPress tutorial we have tried to cover all the basics and few advanced topics.","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"1-hour-wordpress-basic-tutorial","to_ping":"","pinged":"","post_modified":"2015-06-05 03:31:03","post_modified_gmt":"2015-06-05 03:31:03","post_content_filtered":"","post_parent":0,"guid":"http://demo.thimpress.com/learnpress/?post_type=lpr_course&amp;p=1205","menu_order":0,"post_type":"lp_course","post_mime_type":"","comment_count":0,"categories":[{"term_id":35,"name":"General","slug":"general","term_group":0,"pivot":{"object_id":5111,"term_taxonomy_id":35}},{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":5111,"term_taxonomy_id":58}}]},{"ID":5143,"post_author":1,"post_date":"2015-06-05 09:38:02","post_date_gmt":"2015-06-05 09:38:02","post_content":"<h5>WELCOME TO PHP!</h5>\n<div>\n\nThis tutorial will introduce you to PHP, a server-side scripting language you can use to make dynamic websites and web applications.\n\n</div>\n\n<hr />\n\n<h5>WHAT YOU SHOULD ALREADY</h5>\nBefore you continue you should have a basic understanding of the following:\n<ul>\n \t<li>HTML</li>\n \t<li>CSS</li>\n \t<li>JavaScript</li>\n</ul>\n\n<hr />\n\n<h5>WHAT IS PHP?</h5>\n<ul>\n \t<li>PHP is an acronym for \"PHP: Hypertext Preprocessor\"</li>\n \t<li>PHP is a widely-used, open source scripting language</li>\n \t<li>PHP scripts are executed on the server</li>\n \t<li>PHP is free to download and use</li>\n</ul>\n<table id=\"table1\" class=\"lamp\">\n<tbody>\n<tr>\n<th><img src=\"http://www.w3schools.com/images/lamp.jpg\" alt=\"Note\" /></th>\n<td><strong>PHP is an amazing and popular language!</strong>It is powerful enough to be at the core of the biggest blogging system on the web (WordPress)!\nIt is deep enough to run the largest social network (Facebook)!\nIt is also easy enough to be a beginner's first server side language!</td>\n</tr>\n</tbody>\n</table>\n\n<hr />\n\n<h5>WHAT IS A PHP FILE ?</h5>\n<ul>\n \t<li>PHP files can contain text, HTML, CSS, JavaScript, and PHP code</li>\n \t<li>PHP code are executed on the server, and the result is returned to the browser as plain HTML</li>\n \t<li>PHP files have extension \".php\"</li>\n</ul>\n\n<hr />\n\n<h5>WHAT CAN PHP DO?</h5>\n<ul>\n \t<li>PHP can generate dynamic page content</li>\n \t<li>PHP can create, open, read, write, delete, and close files on the server</li>\n \t<li>PHP can collect form data</li>\n \t<li>PHP can send and receive cookies</li>\n \t<li>PHP can add, delete, modify data in your database</li>\n \t<li>PHP can be used to control user-access</li>\n \t<li>PHP can encrypt data</li>\n</ul>\nWith PHP you are not limited to output HTML. You can output images, PDF files, and even Flash movies. You can also output any text, such as XHTML and XML.\n\n<hr />\n\n<h5>WHY PHP?</h5>\n<ul>\n \t<li>PHP runs on various platforms (Windows, Linux, Unix, Mac OS X, etc.)</li>\n \t<li>PHP is compatible with almost all servers used today (Apache, IIS, etc.)</li>\n \t<li>PHP supports a wide range of databases</li>\n \t<li>PHP is free. Download it from the official PHP resource: <a href=\"http://www.php.net/\" target=\"_blank\" rel=\"noopener\">www.php.net</a></li>\n \t<li>PHP is easy to learn and runs efficiently on the server side</li>\n</ul>\n<em>Now it's time to check out of this course. Have fun! </em>","post_title":"PHP 5 Introduction to coding Tutorial","post_excerpt":"This tutorial will introduce you to PHP, a server-side scripting language you can use to make dynamic websites and web applications.","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"php-5-introduction-to-coding-tutorial","to_ping":"","pinged":"","post_modified":"2015-06-05 09:38:02","post_modified_gmt":"2015-06-05 09:38:02","post_content_filtered":"","post_parent":0,"guid":"http://demo.thimpress.com/learnpress/?post_type=lpr_course&amp;p=1481","menu_order":0,"post_type":"lp_course","post_mime_type":"","comment_count":0,"categories":[{"term_id":26,"name":"Backend","slug":"backend","term_group":0,"pivot":{"object_id":5143,"term_taxonomy_id":26}},{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":5143,"term_taxonomy_id":58}}]},{"ID":5164,"post_author":1,"post_date":"2015-06-05 10:16:38","post_date_gmt":"2015-06-05 10:16:38","post_content":"<h4>COURSE DESCRIPTION</h4>\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.\n<h4>CERTIFICATION</h4>\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.\n<h4>LEARNING OUTCOMES</h4>\n<ul class=\"thim-list-content\">\n \t<li>Over 37 lectures and 55.5 hours of content!</li>\n \t<li>LIVE PROJECT End to End Software Testing Training In