 Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on EducationWP (http://eduma.thimpress.com/thim-2/)\nReply-To: [your-email]\n\n\n\n1\n[your-subject]\nEducationWP <admin@eduma.thimpress.com>\n[your-email]\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on EducationWP (http://eduma.thimpress.com/thim-2/)\nReply-To: admin@eduma.thimpress.com\n\n\n\nYour message was sent successfully. Thanks.\nFailed to send your message. Please try later or contact the administrator by another method.\nValidation errors occurred. Please confirm the fields and submit it again.\nFailed to send your message. Please try later or contact the administrator by another method.\nPlease accept the terms to proceed.\nPlease fill in the required field.\nThis input is too long.\nThis input is too short.\nDate format seems invalid.\nThis date is too early.\nThis date is too late.\nFailed to upload file.\nThis file type is not allowed.\nThis file is too large.\nFailed to upload file. Error occurred.\nNumber format seems invalid.\nThis number is too small.\nThis number is too large.\nYour answer is not correct.\nYour entered code is incorrect.\nEmail address seems invalid.\nURL seems invalid.\nTelephone number seems invalid.","post_title":"Contact form 1","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"contact-form-1-2","to_ping":"","pinged":"","post_modified":"2015-10-19 03:56:11","post_modified_gmt":"2015-10-19 03:56:11","post_content_filtered":"","post_parent":0,"guid":"http://demo.thimpress.com/eduma/?post_type=wpcf7_contact_form&amp;p=4","menu_order":0,"post_type":"wpcf7_contact_form","post_mime_type":"","comment_count":0,"categories":[]},{"ID":7403,"post_author":1,"post_date":"2016-09-13 12:55:26","post_date_gmt":"0000-00-00 00:00:00","post_content":"sdfsdf","post_title":"sdfsdf","post_excerpt":"","post_status":"pending","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"","to_ping":"","pinged":"","post_modified":"2016-09-13 12:55:26","post_modified_gmt":"0000-00-00 00:00:00","post_content_filtered":"","post_parent":0,"guid":"http://educationwp.thimpress.com/thim-2/?post_type=portfolio&amp;p=7403","menu_order":0,"post_type":"portfolio","post_mime_type":"","comment_count":0,"categories":[]},{"ID":8804,"post_author":1,"post_date":"2018-11-12 02:53:57","post_date_gmt":"2018-11-12 02:53:57","post_content":"LearnPress is a comprehensive <em>WordPress LMS Plugin</em> for WordPress, just like WordPress Moodle or Moodle for WordPress if you know what Moodle is. This is one of the best WordPress LMS Plugins can be used to easily create &amp; sell courses online. Each course curriculum can be made with lessons &amp; quizzes which can be managed with easy-to-use user interface, we really made it for lazy people.\n\nLearnPress is free and always be free, but it has premium high quality WordPress Plugin which will probably help you make money from your <strong>WordPress based LMS</strong>, try and see how it is. LearnPress WordPress Online Course plugin is lightweight but super powerful with lots of add-ons to empower its core system.\n<h4>LearnPress features</h4>\n<strong>LearnPress - WordPress LMS Plugin works with your theme</strong>\nWe create LearnPress LMS Plugin to work with any WordPress themes.\n\n<strong>LearnPress supports WordPress Multisite</strong>\nCreate WordPress based LMS as multiple sites.\n\n<strong>Create course</strong>\nLearnPress LMS Plugin provide an excellent user interface to create a course with options you need. You can find it easy to make a full curriculum layout as well as edit and maintain it. You can also export course and import to other website which also using LearnPress. We will provide the feature allow you to import course from other WordPress LMS plugins soon.\n\n<strong>Manage course</strong>\nWith the course you've created, you can share it, manage it, watch statistic about number of student, its trend, etc.\n\n<strong>Sell course</strong>\nLearnPress is free but it still allow you to sell courses you create with support many billing method such as Paypal, WooCommerce, Stripe, etc.\n\n<strong>Communicate with your students</strong>\nWith BuddyPress support, LearnPress will help you to communicate with your student or instructor via WordPress forum. Learning is not only on your own. Study, make friends and have fun.\n\n<strong>LearnPress provide a bunch of add-on</strong>\nAdd-on is used to providing extra features for LearnPress and you can also write it.\n\n<strong>LearnPress is free and always will be</strong>\nEducation should be free and we want you to bring it to as many people as you can. Therefore, we create LearnPress as a tool for you to create course and share it. We'll continue developing it as long as we can and make it better and better.\n\n<strong>LearnPress is actively developed</strong>\nWe are developing and improving LearnPress day by day and bringing new features to you cos we want LearnPress to become the <strong>best WordPress LMS plugin</strong>.","post_title":"What is LearnPress","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"what-is-learnpress","to_ping":"","pinged":"","post_modified":"2018-11-12 02:53:57","post_modified_gmt":"2018-11-12 02:53:57","post_content_filtered":"","post_parent":0,"guid":"http://what-is-learnpress","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":8804,"term_taxonomy_id":58}}]},{"ID":8805,"post_author":1,"post_date":"2018-11-12 02:54:00","post_date_gmt":"2018-11-12 02:54:00","post_content":"Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old.\n\nRichard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.\n\nLorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.\n\nThe standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.\n\nThere are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don't look even slightly believable.\n\nIf you are going to use a passage of Lorem Ipsum, you need to be sure there isn't anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet.\n\nIt uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.\n\n&nbsp;","post_title":"How to use LearnPress","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"how-to-use-learnpress","to_ping":"","pinged":"","post_modified":"2018-11-12 02:54:00","post_modified_gmt":"2018-11-12 02:54:00","post_content_filtered":"","post_parent":0,"guid":"http://how-to-use-