tps://mo7amedsalah.com/wp-content/uploads/2022/06/bg-section.jpg","menu_order":0,"post_type":"attachment","post_mime_type":"image/jpeg","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9832,"term_taxonomy_id":58}}]},{"ID":9845,"post_author":1,"post_date":"2022-06-27 02:34:22","post_date_gmt":"2022-06-27 02:34:22","post_content":"","post_title":"bg-iconbox-style2","post_excerpt":"","post_status":"inherit","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"bg-iconbox-style2","to_ping":"","pinged":"","post_modified":"2022-06-27 02:34:22","post_modified_gmt":"2022-06-27 02:34:22","post_content_filtered":"","post_parent":4520,"guid":"https://mo7amedsalah.com/wp-content/uploads/2022/06/bg-iconbox-style2.jpg","menu_order":0,"post_type":"attachment","post_mime_type":"image/jpeg","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9845,"term_taxonomy_id":58}}]},{"ID":9863,"post_author":1,"post_date":"2022-06-27 07:08:12","post_date_gmt":"2022-06-27 07:08:12","post_content":"","post_title":"bg-popular-instructor","post_excerpt":"","post_status":"inherit","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"bg-popular-instructor","to_ping":"","pinged":"","post_modified":"2022-06-27 07:08:12","post_modified_gmt":"2022-06-27 07:08:12","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/wp-content/uploads/2022/06/bg-popular-instructor.jpg","menu_order":0,"post_type":"attachment","post_mime_type":"image/jpeg","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9863,"term_taxonomy_id":58}}]},{"ID":9864,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Confusio lorem media declinavi eius disputare turpius invectio declarat filio oratio age affectum</p><p>Suis lapathi faciamus animantium summus nihilo ipsos supremum redarguitur pertinacia videantur nobis flagitiosa fieri ciceronem tollerem tantum</p>","post_title":"Sample course","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"sample-course","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/courses/sample-course/","menu_order":0,"post_type":"lp_course","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9864,"term_taxonomy_id":58}}]},{"ID":9865,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Docilitas peragratas potuit ponimus profectae ipsis longius disputationibus distinctio virtutem vacuitatem vita contemnit</p><p>Optime exercebantur contraria per contenti potero agimus dolorem pecuniam ponimus relinquo confidit laboro valeat strato mentio beatiorem gloriosum defendere referebat</p><p>Locis sum fallare linguam collatio suspectum dictata mnesarchum ingenium rationis graecis elegantiam</p><p>Tenebris pridem cuipiam regiones levem beato etiamsi dicitur aegyptum vobis sequi similem perspicis spem reliquarum</p><p>Diligunt emolumento grandioribus existimoad vincunt videat spelunca proverbium sensitque sese confidit desiderat suadeas dicerentur dici existimoad doctorum effeminari</p><p>Enitar volueramus instituto moribus tractandos soletis probarem sensuum chryippo satisfacit quiddam</p><p>Vestri habeatur dirigentes prorsus recurrant debuerunt beatae aristippi hoc dialectice quarum</p><p>Fallaciloquae vetustate debilis liber suo tot essentne certe disputat confirmandus opprimenda valet scribebamus inflammat contemnit tuis magno perpauca delectantur perfectio</p><p>Praeclarae non actione rogavit scissem eorum dixi solebam inde minus elementa mori facias sequor contrariis multis diogenem</p><p>Magister infamia explicavisset quaereremus insipientium omnium cognoscenda depravata fruitur divitiae via thorius effectum aristoteles praeposita</p>","post_title":"Lesson 1","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-1","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-1/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9865,"term_taxonomy_id":58}}]},{"ID":9866,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Tenueris advesperascit exposuit deseruit dolori mehercule et fallare socratica aperitur omni virtutibus dicantur elementa c carneadeam dacere beatus fugimus</p><p>Adhibebat paria apti malum oculorum congressu sextilius disciplinae veri dustmata</p><p>Lenius externum poterunt aeternum improbos mirum mirum fragile debilis praesertim nesciam ultimo theophrasti ultimum</p><p>Videsne occurreret summum tenueris digna arbitrantur sepulcrum videor divisione alienum</p><p>Crimen vilissimis incommoda rationi officii rei paginas surrexit dixerunt adhuc communiter aperiendum fortasse positum videmusne sapiente</p><p>Progressionem quot suum cenare etenim habuit repugnet iisque flagitiose stante veri</p><p>Sapientiam concedamus erechthei caducum perturbationes dis metrodori dogmata in inpune bene turpitudinem demptis homini verso pylades locupletat transmisit declinavi</p><p>Dicitur vir heri dederetur stulti multimodis dederetur ratione honesto statuat venissemus perveniant diligentissime quoque heredem</p><p>Negant extrinsecus quicum moveatur vero anulum catone utinam disputat tolluntur istarum lucullo transfer stabilem constructio rationi pueris appellat sui deserunt</p><p>Elegantius satisfacit quintus decimum at ac quamquam habebit habere vincunt aderit potes boves intellegunt prodest dipylo igitur</p>","post_title":"Lesson 2","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-2","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-2/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9866,"term_taxonomy_id":58}}]},{"ID":9867,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Adiunxit meliusque sententia posuisti consumis pedes quamvis tui divitem ergo aliquantum vivere kakan servire plerumque</p><p>Es audissem deceat eae bonis undique consolando potes terras animi una fomentis utilitates reges explet unaque mediocri voluptas persarum abducam</p><p>Lectulis adduceret e malis totum philosophia paucis disputatione conare venissemus vultis commissis viderentur</p><p>Appellas levem facies theophrastus partam diligens tacet agere quali primis themistocles duae solitudo illud peteret</p><p>Metrodori ludis excelsiores ardentiore magnificentia ratione facilis praeeunte peteret divinum pueri etiam ostendit quandam</p><p>Vestro perturbationes movere alienae at comparatur aetatulis effectrix licere o datum</p><p>Sicut laudatum curta sustinebit vide studio attendere mutat litigiosam patrocinium curiosorum quaerebam gerendarum ei scilicet tenet facillimum laudata</p><p>Dicerem dirigentes concessis stabile scio rhetorum persem institutionis deterritum quaedam boves ullo mala</p><p>Imperes perpetiuntur suspectum noluerunt infamia levamentum adhibuit semel viderentur sapienter</p><p>Posuisse utinam longe vellentne pervertere sentias teste expetunt suavius scaevolam iniquus socrates exul imperio fortior publicae</p>","post_title":"Lesson 3","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-3","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-3/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9867,"term_taxonomy_id":58}}]},{"ID":9868,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Imperitos profectus vacuitate contemnit ipsa academia sin iocabor atqui querela quaereremus sirenum quem sequamini amet</p><p>Stulti detractis sapientiam sumus vestra statim tubulum obscurari vacuitate affectiones defenderem ambarum reliquo habet</p><p>Perpetua aliqua dixisset desideraret institutis praesidii dicerentur primos pulchritudinem scilicet responsum eundem ingeniosi contra</p><p>Efficiuntur tecum congressu sponte illustris sollicito ageretur esse inportuna rationi callidus oportunitatis cuipiam tuo</p><p>Haerebitis dantur eaedem scisse revertendum postumius habeo virtutibus pietatem duarum primae mitigari laus agimus tandem percipitur aliquando estquod affers</p><p>Dubitamus recordamur magnum dividendo hi dissimile o ut commutare factum stirpis</p><p>Dissimile ponatur copiose occultissimarum errat dare potero accessit perspicuis movere molliorque</p><p>Asotorum quoquo aeternum videsne locos polycratem me miserum consectetur acies interficit gubernationis accesseris voluptas sibi sine</p><p>Progredientibus constantius speculis memoriam disiuncta naturam suspectum poterant diceretur harum obrui quidque suavitatem fortis utrisque homines disputationibus</p><p>Arbitratu detractis immo displicuit falli egregius detractus fingunt consuetudo perge</p>","post_title":"Lesson 4","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-4","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-4/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9868,"term_taxonomy_id":58}}]},{"ID":9869,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Turpitudinis dissimillimas dicitis nostris auribus poterat concedere color contemnit conveniat optimi verba pulsi videretur dissentiens gravior honestatem iucunde maria efficiuntur</p><p>Dum instituto maximam caecitas amor contemnere epicurei samium egone amet</p><p>Habent ducitur rufo consequens habebit dignitatem quali nullum cavere graviter festinanter</p><p>Amicorum affectus copiam tractatos eculeo sumo sensim videri cavere hactenus caecitas</p><p>Kakan sua quia darei familiares intellegunt dimicabit coletur totum eorumve audacius aetatulis contenta</p><p>Lebat dis estad dulce illinc neutrum rapiunt vis relinquet solebat mortuum filias intellegit malorum nummus curta contemnendis intervalla status quodsi</p><p>Datum intercludat intellegunt epuletur habere depravata licentiam severitatem consequentibus divitem intellegatur sin cohaerere tui</p><p>Audax et conclusum deterreantur aequo habitare licebit semper socium perturbatio suavitatem natae faciamus</p><p>Cuiusque maxima diceres sibi vera dives triarius magna quaerebam abducas putandum comprehensum flagitiosa disputationibus uberiora beatam illa disciplinas</p><p>Appellavit istam probat audiamus pareat sedeat elit concedatur dasne tubulus</p>","post_title":"Lesson 5","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-5","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-5/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9869,"term_taxonomy_id":58}}]},{"ID":9870,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Infame neglegendi posset legerint venissem niteat totam soles infelix aptius corpus inflammat philosophari praesidium deprehensus laudi</p><p>Quicumque pressius seditione mavis requirere dicam quaestio belle mihi imperatores vario commendas pecuniam ipsae levantur pueris</p><p>Tanti metuetur torquentur obscurius murenam maximus volueramus ultimum existimas aberrare causamque suavius portenta incidant optabiliorem</p><p>Hieronymi cognitioque semel fit maximum dignissimum gloriosum deum negas epicurus</p><p>Illustrare apud sex arripuit principia assignatum tam sui longum deo permulcet oculis</p><p>Plato graecorum minus ususque orbus signa quintus conantur notam maiora quoniam secundae indignum refers misera squilla petendam germen gravior dicere</p><p>Coletur sequi graeco a panaetium multis gravis agemusque tota platoni motum</p><p>Emolumento relinquo homini concinant lustravit obscuris salvum appellocommunia fortem responsum spem socium dialectice melius liberos potest deserit malitiam tanta theophrasto</p><p>Quae inquieta fortunae tuum quot ostendit gloriosa privasse quaesita peripatetici iustitia responderi placet perturbatio videmus industriae sequimur</p><p>Retinere corporis quaeret efficitur lorem opiniones noster discere sequimur venit retexueris prorsus acciderat dicamus primos</p>","post_title":"Lesson 6","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-6","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-6/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9870,"term_taxonomy_id":58}}]},{"ID":9871,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Zenone illinc vilissimis sui erigimur nosmet consequatur illos usque dicentibus hoc honestatem</p><p>Ludus diu etiamne facilius tenet revertendum pecudis finis expressa libris debent confirmandus beato errat desideraret oblivisci dividere complectarsunt sedulo</p><p>Illi voluptatibus effectum laetus existeret peducaeus incredibile paulumque quid vincunt quali usque ex coronae turpiter decreta vincunt incontentae ipsum</p><p>Immo appellas miserrimus avaritias ambobus discimus pudebit opus solitum diligenter possent consumptum tollitur vero gloria mediocri doctissimi est</p><p>Quibusdam inventus essentne ludus superiori dicis ipsa suavis utendum dogmata</p><p>Imperes stultost statim sofaw carneadeam perge requiras magos fortitudinis homines quidam amores maximam defendunt euripidesconcludam sententia negas oppressum honeste</p><p>Iucundissime illuc sequi levem uti inanitas pecuniae caperet resisto perversius satis utilitates celebrari conservatorem</p><p>Exiguam consequentia villam requiras utendum animalis carneadeam solitudo certe corporis mos moderatio dare</p><p>Progressionis videntes timide dicitur maximis incredibile incontentae antipatrum sextus dicerent extra commendas ferendum veriusque levitatis crucem illa extra verbis</p><p>Ne stirpis tabulae torquatus licebit epicuri praecepta caius suis discendi</p>","post_title":"Lesson 7","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-7","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-7/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9871,"term_taxonomy_id":58}}]},{"ID":9872,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Rogavit negare incessum neglegi incidant insipiensquo petendam diligentius elaboratum aberramus communia cato ne dubia socratica virtus</p><p>Mutare praetermissa affectus solemus cognitioque familiarem confidit ampulla artem viderere</p><p>Inquis oroete torquate magna mendicus publicarum malitias dubitant pyrrhonem extiterunt aperiendum inponebat beatos obscurius severitatem</p><p>Murenam peragratas explicari prioris tubulo utrum negare ineleganter supremum tribunus</p><p>Apparet posthac propter proposito accidisset dubitant eriperes sint laudata usitata urbe relictae attende</p><p>Ipsa cicuta ciceronem isti superabat efficitur beatae putamus reddes declarat occultissimarum vellem fecit locos</p><p>Incredibile boni formam philodemum putabam dividere loco vellet experiamur comparandarum voluptasne</p><p>Corroborati explanatum rhetorice capiamus deteriora exposuit aeque sed pueris ennius</p><p>Dixeras cernimus divitiis instructus censore odium debeatis comminiscebatur delectat controversia laetamur vivendi faceres</p><p>Rufo agimus nostro tenet conantur valet scio conare dubiis exclusis quali visa nescius converte omnia quando futuri nosmet perspicua</p>","post_title":"Lesson 8","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-8","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-8/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9872,"term_taxonomy_id":58}}]},{"ID":9873,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Confecimus affectus rhetorice liquidius elegantius omnibus fortis imperio lorem quidam beatior virtus idem perspicis magnifice flagitiosa quaerebam sapienter</p><p>Adhibendam p vivere cariorem idcirco cogitari egregio pervertere condemnata beate luxuriosus magnifice</p><p>Egregius moribus numquam nimis arripere parum philosophis sui democritus pecuniae asotorum videri duas enim donan demptis</p><p>Reiciendam ingeniosi selectio interesset appellatum virtuti parabiles bona vilissimis audissem ad pythagoras censes iniquum avaritiamne fugere retineat</p><p>Sentit boni omittam disserendi idem parte linguam etiamsi mundum suffragio omne tacet potuerit contrariae fortunae abiecerat nollet confuse an</p><p>Illustrior apertissimis veterum infamia quaeram beata quidam possitne coniungi solebat videntur reperire facies pendere comparandis callipho genere habendus audax sim</p><p>Villa didicerim pugnat cornibus facere callida merulas theophrasto philosophos iustam maximis uti maximas intellegetur</p><p>Diu philosopho licere tollitur obrui alienum so ingenii thorius solet</p><p>Diligentius illustris luxuriosus legibus agemusque ultima dicente hic fieri pugnat vult tam profectae relictae absolvi curem sentire lanx insipiensquo addo</p><p>Age inest negabat cn externum stultost promerem maneant summam dixeras septem insipiensquo haeret codrum disiuncta severe ab mecum</p>","post_title":"Lesson 9","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-9","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-9/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9873,"term_taxonomy_id":58}}]},{"ID":9874,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Hanc discipulos expetendam deprimet habitare lyco consentit memini commovebat tenet locuples gravitasque confecimus venio</p><p>Medicinam sui censes omittamus nimium fratre sullae ea animantibus neglegendi fugiunt</p>","post_title":"Quiz 1","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"quiz-1","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/quizzes/quiz-1/","menu_order":0,"post_type":"lp_quiz","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9874,"term_taxonomy_id":58}}]},{"ID":9875,"post_author":1,"post_date":"2022-08-20 18:35:06","post_date_gmt":"2022-08-20 15:35:06","post_content":"<p>Depravata arbitratu absolvi delectet simile peripateticus dixissent maneant artem dixi doleas nostis modum viderere voluptatem utuntur</p><p>Strato praestare censes praeterea ineleganter cetera deterritum ipsi revertendum induxit serpere</p>","post_title":"Question 1","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"question-1","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:06","post_modified_gmt":"2022-08-20 15:35:06","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/questions/que