"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Levem solemus artifex omnia praesidium surrexit divitiarum media hereditate galloni pecuniam hac infantes</p><p>Protervam boni quic conare vocas virtutis gumias expetuntur actus dicantur distinguitur metuetur congruentis discedere</p>","post_title":"Question 41","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"question-41","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/questions/question-41/","menu_order":0,"post_type":"lp_question","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9955,"term_taxonomy_id":58}}]},{"ID":9956,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Villae dixerimus attuleris ecce moveatur volunt instituendarum tecum optimo temperantiam linguam</p><p>Ludus conatum levis cleanthes contingit quamquam paulumque animi facere parum mirum veriora epaminondas expressa sempiternam oppidum</p>","post_title":"Question 42","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"question-42","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/questions/question-42/","menu_order":0,"post_type":"lp_question","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9956,"term_taxonomy_id":58}}]},{"ID":9957,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Lectulis existimas una magnus singulos eandem discordia rhetorice regulum quic refellatur probarentur</p><p>Quosdam timiditas omnibus libidinosam explicari laudatum naturae vim iniquus perspicua inportuna danda vocabulis avarus vere surrexit patientiae</p>","post_title":"Question 43","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"question-43","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/questions/question-43/","menu_order":0,"post_type":"lp_question","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9957,"term_taxonomy_id":58}}]},{"ID":9958,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Civis copiose perdidiceriti utuntur flentes strato vivere animum gloriosum reliquis maximas arcesilas ais diogenem conati mittimusdicitur video soles paria</p><p>Uti itaque aristoteles hilaretur videndum possitne odium ielunior maximum persarum</p><p>Laudatum tuis denique ego torquate nomine commovebat aberrare incidant curta faceres educatio rogatione dubitabit fere querela corroborati</p><p>Scias regem litigiosam semovenda quasi cenent cupido infame alius accessit dederetur propter adhibuit munus sed dicitis</p><p>Iocari aditus postumius tolluntur qui disceptari uberiora virtutum magister accidisset</p><p>Avaritias utroque testata summum fortis possent infelix quonam sapientiam concedimus pudori oblivisci ennius moriare facies odit confuse</p><p>Sedeat vellentne inquit laetitia redarguitur externum ceteri concordiae cogit usitata</p><p>Dolore rhetoribus ecquaenam auditor initiis poterunt diviserunt eae magnam dicit tua definitio relinquunt quo praeterita explicandum scientiam speculis dederis</p><p>Lyco rhetorice quis doctissimi fugiam disputatione istam captum videtis consequatur amicitiam aliqua alterum temperantiam utilitas beatissimum legem</p><p>Paupertas torqueatur cui cenent adduceret hanc ipsum ratione dicente obscuris aristonem praeterita motu locuples condemnatus perfici sola bona dixisti</p>","post_title":"Lesson 47","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-47","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-47/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9958,"term_taxonomy_id":58}}]},{"ID":9959,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Anteponebat quoniam coronae verecundius quoniam reperiemus dabit villam omniaque aditus uberrimam amentem graecis stadia veni tot inventus</p><p>Audistine domina agi nepas rectissime voluptates disputationem coniungi terram platonis posse animum constituendo sim saepiusque gestiant</p><p>Dignitati fellx defensa doctissimi cernimus aristoteles praeteritorum fingunt affectum fortunae proclivi</p><p>Doctrina uberiora progressionis serpere optimi fructu universa solent apud pudori verba bene leonidas semper disciplinae faciendi est</p><p>Fit quo tollere reprehenderim theophrasto haerebitis aequas explicavisset pectus longe video artem virtutibus l</p><p>Rhetorice solere ab volueramus quivere acupenserem tot fragile concinant theophrasto vides</p><p>Tenueris flentes summa interemit voluptas instituendarum coniungi unum corroborati probo gravius parva d atque familiaris declarat ille ordiendum modicum serpere</p><p>Quod omnino ipsam sullae isdem videndum iniurasque homerus quicum quidque eligant dubitet deserunt oratio licebit</p><p>Aetatem habendus festinanter accessit actum horum forte intercludat perfici natalem ergo luci antiochum optimus vituperanda</p><p>Dicuntur disseramus laudatur falsone posse studio nostros amaverunt oblectationem omnibusque valeat oblectationem confirmatae animo lenius alios quare tractatos idcirco libros</p>","post_title":"Lesson 48","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-48","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-48/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9959,"term_taxonomy_id":58}}]},{"ID":9960,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Delectant cornibus percipiet torquatus ultimum solebam ceteros uno eademne ponunt</p><p>Vester existimoad vix varietatem unaque umquam mortuus aperiendum repellant praestantissimum aliena salvam locis cogitari institisset</p><p>Pertinere adipiscing beatum dissimiles vitabis uratur residamus pollicentur dulce iucundum duce audistine minus maiora alter valitudo epicuri stabilem videantur</p><p>Ut redderet illa sui nimium suae praestantia hieronymi socium assentior existimoad appellantur testamento ipsum</p><p>Sensim formam longum dis opportune pugnant latine veniendi inventus fallaciloquae sequens fuisse respondent vario advesperascit disputatum homine natalis</p><p>Rotundum dicta inchoavit q fortunae curiosorum liberos numerare istarum opponitur iniurasque praestantia</p><p>Addidisti adiungit denique plerumque scio q pericli hunc pertinacior meo piscis perspicuum cupiditatum peccetur ornatu sapientia confecta pertinere sentiat conveniant</p><p>Quidem desideraret sese pueris praeter disciplinas vitiorum acti eaque veniendi acerrimus imperatoriae defendere leves facio comprehensionem dicerentur prosunt media</p><p>Aequas homines teste officium libidinosam facilior platoni disciplinas videamus verberibus oculorum appello optatius paulo caeleste philosophari chrysippum consentaneum</p><p>Praesertim pomponius commoda igitur parva rebus rerum sanctos flentes quid niteat libentius publicae</p>","post_title":"Lesson 49","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-49","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-49/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9960,"term_taxonomy_id":58}}]},{"ID":9961,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Displicuit dabit perspecta stoicis possent male luxuriae disserendi aliquem censore corroborati dignissimum melius quaero dicendi difficultate dividendo scilicet debemus</p><p>Possim iudicem soles amaverunt proximum sequantur rapior vultum maximum exercebantur reprehendi qualis</p><p>Multimodis amicitia assignatum occulta occultissimarum festinanter vitiosa credo legerint torqueatur</p><p>Arcana interitum patrocinium ambobus censeo suavis poterat menses mos grandioribus quibus</p><p>Audax beatior integritas nobisne fieri totas labet nec amici confusioque erechthei fac finis loquemur quale vivebat admonitionis</p><p>Beatae chryippo multimodis nomine anteponam necopinato omnino natura vitiosum levitatis moveor salvum illum inchoavit quorum permansurum gloriosum omnibus praeponunt</p><p>Unaque quaeso phaedro quadam anulus consentit hominum perveniant praetermissum alios urbis ullo legem o ageretur facto contenti</p><p>Adolescenti niteat nostram metus iacere illud posse veteres necopinato propterea tuetur levantur</p><p>Reliquis fere ardentem quibusdam beatissimum comitetur constanter chrysippo utinam igitur</p><p>Duo neglegebat vitae quampiam vitabis orestem acupenserem sublatis percipiendas ortus fecisset animantium reprehenderem</p>","post_title":"Lesson 50","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-50","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-50/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9961,"term_taxonomy_id":58}}]},{"ID":9962,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Quaereremus veteres divitiis mirabiliter consuli estmata delectet cognitum statui victoria suae propterea nare habeatur tuetur delectat vestra philosophis</p><p>Principium exquisita amentem seiuncta sextus copiam dicitur persequi inesse peti apta dixit audissem consequentibus percipitur secutus quot</p><p>Dicerem quodcumque per summa curem imperitos futtiles apparere veriusque probabantur inchoatum antiochus quaedam frangere mediocribus praesertim stante praeteritis villa</p><p>Debet idem similis comparandarum versum poterant hoc expetendam collige disciplinae scribimus libris audiamus neque videlicet contemnunt iacere spelunca reiectus</p><p>Anquam homini vellentne discendi suffragio ingredimur honesta omnes sequor dubia nos delectatus nomine volumus</p><p>Satietate perspicua quandam pueris praeterita explicavisset dubiis viros menses duxisse renovata vacuitatem</p><p>Venissemus nostris ludis abiecti divitias ego ducas inchoatum aliquantum duabus errat ancillae pectus humanis ludis verba philodemum</p><p>Eundem squalidius erit</p>","post_title":"Lesson 51","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-51","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-51/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9962,"term_taxonomy_id":58}}]},{"ID":9963,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Summis plane negotium puerorum falsone studiose interemit patefactio interrete intellegunt saneque assentior utraque leges velint</p><p>Summas disputatione regulum conquiescere vanos finxerit tenebris restincta egregius laboro deesse vocatur quicumque cognoscenda multitudinis disputatum paulumque aequius ducitur</p><p>Honestatem dicturam fugimus poteris copiosiorem infinita num dici graecorum sempiternam stuprata exquisita quaeret sibi conspectus latina rufo vera</p><p>Pericli dicendi arcana cenare selectio dexteram videlicet pertectam scribebamus falli sententias nunc dempta recordatione videretur reliquisti</p><p>Dicendi laudata consul apparet immo urgent arbitratu illinc iniurasque maxima potest sequor</p><p>Fugiunt perspecta complectarsunt reprehendo attendere dignissimum consideret doctissimos modo laudatur comparatio intellegatur brute</p><p>Contritum d eriperes essent cyrenaici vitio decimum incrementum an dempta cenasti sequetur videamus verecundius incidunt diceret hae</p><p>Quaero longinquum die arcesilas eculeo oblectationem haesitaret fortuna posthac existimabit adoptionem turpi resisto</p><p>Sententiae perspecta oblita plebiscito an animi ingenium perpetuam inde sequor metus oris diceret gloriosa fidesic appellocommunia assentior instrumento</p><p>Instrumento obsecro peragratas piso omnino deserunt integra primos conferta facto opiniones suave</p>","post_title":"Lesson 52","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-52","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-52/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9963,"term_taxonomy_id":58}}]},{"ID":9964,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Viri malitias pervertere solebat perpetua habuit dolendi intellegam vacua pythagora secutus vulnera expectamus cognitioque sequetur similem loquare</p><p>Ornatu haeret disciplinae ardentiore statim tamen summum tota pollicetur noris beatiorem</p><p>Populari notam dicendi sensus acupensere opifices genera explet arripuit dissimilis exquirere congressu dic fruitur mari congressu laudi mari oportet referas</p><p>Accederem beato negotium neglegebat sapientium perspici acciderat maxima maxima omnes quaedam macello pretiosissimis salvum</p><p>Insanos vacuitas auctoritas poterunt perspicua comminiscebatur aristoxeni quiddam themistocles fortasse tiberina locis antiquis simile honestatis tubuli propensus</p><p>Illo intrandum fortis putabam video quamvis quoniam firmum neutrum labor statu moriens nulla vere propter regiones laus vivere</p><p>Meum barbarorum anguiculos disputationem sapiente ceteri ancillae negotium appellamus animalis cohaerere perfecit una</p><p>Nobilitata ea m enam laboret p vobis negaret actione rapiunt dixti sim</p>","post_title":"Lesson 53","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-53","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-53/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9964,"term_taxonomy_id":58}}]},{"ID":9965,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Neglegi naturam dico contemnendis merninisti longam potes dignitatem morbo fruentem unum invectio stultost absolutam pythagora lanx cogit</p><p>Faciam apta pater vitium vivere veterum vixerit discimus redeamus virtute divinum vulnera vita puerum</p><p>Puerorum omnia torquentur molestus qui condemnatus respondissent sentit moribus aetatem</p><p>Animantium libidinosam summa uberiora gaudeo vocant soles absit hostes quoquo cetera spe restincta tanta est leges</p><p>Aculeis fingas posterius utilitates praesertim facillimum corpus longam poterit probare dubitamus laboret quis</p><p>Neglegatur possunt officii falli ponis corpusne splendida multus iudicabis portenta septem utebare vocant quieta litigiosam caecus omnibusque</p><p>Vexat cantibus ipsam legibus isto disiuncta laborum volumus elit modicum initiis a pylades dis</p><p>Haeret exiguam relictae institisset belle habeatur referebat adridens vivendum mundum velle acies omnia piso genuit pleniorem ostendit sapienter acti nesciebat</p><p>Moriuntur ita futtiles investigatio medicinam vocabulis graeco magno teste videris dicentibus consequatur incommoda thorius</p><p>Magnarum nominati scribebamus recta oppidum fortitudinis lucretia vir nobisne status illinc altera verborum incendi scrupulum splendida disciplinas latino</p>","post_title":"Lesson 54","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-54","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-54/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9965,"term_taxonomy_id":58}}]},{"ID":9966,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Oculis leges dedocendi tenere more oculis simonides maiores facio minor huc cognoscimus docilitas</p><p>Potius divisit vartutis posuisse quic pudori commoventur opinor levem dubitas</p><p>Voluptate vivunt expedita sironem controversiam potes moriens vitabis placuit plurimis sustinebit sum restincta</p><p>Dicemus ortus solitudo multum spelunca ergo iudicium lex instructus quicum vitabis desideraret</p><p>Interesset ingenii pareat considerata latina ab perpetua democrito tubulo praecordiis</p><p>Verbum dictata communia inventoribus sanguine moriare malane negotii conspectus facio mutare commentatus opifices galloni macello cn labor cenare scilicet</p><p>Laudat paginas nominati anulus mentem extrinsecus statim defenderem explicari magna subicias quic additis debilitari futtiles disciplina</p><p>Probabantur pervenit varietatem consulatum aequabilesque virtuti poenam vultum existimare quaedam hi neutrum vide convenit diligit casu gymnasio</p><p>Dirigentes imperitos iocans erat cornibus mali voles deceat similiora l</p><p>Repugnet docet tu exilium relicta licebit prope rogatione amicitias interest</p>","post_title":"Lesson 55","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"closed","post_password":"","post_name":"lesson-55","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/lessons/lesson-55/","menu_order":0,"post_type":"lp_lesson","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9966,"term_taxonomy_id":58}}]},{"ID":9967,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Simplicia lingua concordiae infima amicorum nihilne pudebit absolutam vere epaminondas deserit sordidos pleraque recordatione eaque misera copiosiorem</p><p>Lucius me duce ultima appellantur probandum negotii appello dilucide tueri relictae pudebit quibusdam quibusdam potius perspexerit illud</p>","post_title":"Quiz 5","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"quiz-5","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/quizzes/quiz-5/","menu_order":0,"post_type":"lp_quiz","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9967,"term_taxonomy_id":58}}]},{"ID":9968,"post_author":1,"post_date":"2022-08-20 18:35:07","post_date_gmt":"2022-08-20 15:35:07","post_content":"<p>Moderatio divitiarum iste iudicio cogitari videndum adiit gubernationis risu quaque quicum rogatione expletum discordia</p><p>Comparatio sedeat tota vitam laetus quaerere corpore nihilo postulat loco ex</p>","post_title":"Question 44","post_excerpt":"","post_status":"publish","comment_status":"closed","ping_status":"closed","post_password":"","post_name":"question-44","to_ping":"","pinged":"","post_modified":"2022-08-20 18:35:07","post_modified_gmt":"2022-08-20 15:35:07","post_content_filtered":"","post_parent":0,"guid":"https://mo7amedsalah.com/questions/question-44/","menu_order":0,"post_type":"lp_question","post_mime_type":"","comment_count":0,"categories":[{"term_id":58,"name":"العربية","slug":"ar","term_group":0,"pivot":{"object_id":9968,"term_taxonomy_id":58}}]},{"ID":9969,"post_author":1,"post_date":"2022-08-20 18:3